function retorna_cedulas(custo,pagou){var troco=pagou-custo;if(0>troco)return-1;var cedula_cem=parseInt(troco/100,10);troco-=100*cedula_cem;var cedula_cinquenta=parseInt(troco/50,10);troco-=50*cedula_cinquenta;var cedula_dez=parseInt(troco/10,10);troco-=10*cedula_dez;var cedula_cinco=parseInt(troco/5,10);troco-=5*cedula_cinco;var cedula_um=parseInt(troco/1,10);troco-=1*cedula_um;var moeda_cinquenta=parseInt(troco/.5,10);troco-=.5*moeda_cinquenta;var moeda_dez=parseInt(troco/.1,10);troco-=.1*moeda_dez;var moeda_cinco=parseInt(troco/.05,10);troco-=.05*moeda_cinco;var moeda_um=parseInt(troco/.01,10);return{100:cedula_cem,50:cedula_cinquenta,10:cedula_dez,5:cedula_cinco,1:cedula_um,.5:moeda_cinquenta,.1:moeda_dez,.05:moeda_cinco,.01:moeda_um}}